import React from "react";

import Skeleton from "react-loading-skeleton";

const CardSkeleton = () => {
  return (
    <div className="card-skeleton">
      <div className="top">
        <Skeleton style={{ width: 10 + "px" }} />
      </div>
      <div className="middle">
        <Skeleton />
      </div>
      <div className="bottom">
        <Skeleton />
      </div>
    </div>
  );
};

export default CardSkeleton;
